INSERT INTO stocktracker.stock_analyst_consensus (uuid, customer_id, ticker_symbol, comments, analyst_strong_buy_count, analyst_buy_count, analyst_hold_count, analyst_under_perform_count, analyst_sell_count, analyst_sentiment_date, avg_analyst_price_target, low_analyst_price_target, high_analyst_price_target, analyst_price_date, notes_source_id, stock_price_when_created, version, create_date, update_date) VALUES (6, 1, 'ADMA', '<p>There is very sparse analyst coverage on this small cap name.&nbsp;In mid-November the stock&nbsp;<a href="https://www.benzinga.com/news/17/11/10778171/raymond-james-upgrades-adma-biologics-to-outperform" target="_blank" style="color: rgb(2, 73, 153);">was upgraded to Outperform at Raymond James</a>&nbsp;with a $5 price target, as the analyst cited increased confidence that RI-002 would be eventually approved and lowered risk after the recent equity raise.&nbsp;Maxim Group issued a Buy rating and a $13 price target some five months ago.</p><p>Insiders have been purchasing shares recently, including beneficial owner Biotest AG scooping up 5,813,954 shares in the latest secondary. CMO James Mond&nbsp;<a href="https://www.chaffeybreeze.com/2017/11/14/adma-biologics-inc-adma-cmo-james-mond-purchases-10000-shares-of-stock.html" target="_blank" style="color: rgb(2, 73, 153);">picked up</a>&nbsp;10,000 shares and director Eric Richman&nbsp;<a href="https://www.tickerreport.com/banking-finance/3031799/adma-biologics-inc-adma-director-eric-i-richman-acquires-25000-shares-of-stock.html" target="_blank" style="color: rgb(2, 73, 153);">bought</a>&nbsp;25,000 shares. All transactions occurred on November 9th.</p><p><br></p><p>https://seekingalpha.com/instablog/498952-bret-jensen/5075939-hope-3-biotech-stock?app=1&amp;uprof=45&amp;isDirectRoadblock=true</p>', 0, 2, 0, 0, 0, null, 5.00, 0.00, 13.00, null, null, 3.19, 1, '2017-11-24 14:02:10', null);
