INSERT INTO stocktracker.stock_analyst_consensus (uuid, customer_id, ticker_symbol, comments, analyst_strong_buy_count, analyst_buy_count, analyst_hold_count, analyst_under_perform_count, analyst_sell_count, analyst_sentiment_date, avg_analyst_price_target, low_analyst_price_target, high_analyst_price_target, analyst_price_date, notes_source_id, stock_price_when_created, version, create_date, update_date) VALUES (10, 1, 'EPZM', '<p><span style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">The median analyst price target on EPZM is just over $22.00 a share by the ten or so analysts that cover the company. A slew of analyst commentary came out earlier this month. HC Wainwright reiterated their buy rating and price target of $25 a share. Also, on Nov. 2, 2017, Leerink also came out and reiterated their outperform rating, but lowered their price target from $28 to $22 a share. The analyst over at&nbsp;</span><a href="https://thefly.com/landingPageNews.php?uuid=2634655&amp;headline=EPZM-Epizyme-price-target-lowered-to--from--at-Leerink" target="_blank" style="background-color: rgb(255, 255, 255); color: rgb(2, 73, 153);">Leerink stated</a><span style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">&nbsp;that "the most significant disclosure concerned regulatory timelines for its lead asset, tazemetostat, which is now likely to be approved for its first indication in 2019, rather than 2018, and for its most important indication, NHL, in 2020, rather than 2018." RBC Capital seems to be the only analyst firm with a negative view on the stock, recently reissuing their Hold rating and $16 price target.</span></p><p>https://seekingalpha.com/article/4127139-initiating-epizyme-watch-item-stock?app=1&amp;uprof=45&amp;isDirectRoadblock=true</p>', 1, 1, 1, 0, 0, '2017-11-25 08:12:06', 22.00, 16.00, 0.00, '2017-11-25 08:12:06', null, 11.90, 1, '2017-11-25 08:12:06', '2017-11-25 08:12:06');
INSERT INTO stocktracker.stock_analyst_consensus (uuid, customer_id, ticker_symbol, comments, analyst_strong_buy_count, analyst_buy_count, analyst_hold_count, analyst_under_perform_count, analyst_sell_count, analyst_sentiment_date, avg_analyst_price_target, low_analyst_price_target, high_analyst_price_target, analyst_price_date, notes_source_id, stock_price_when_created, version, create_date, update_date) VALUES (13, 1, 'ACAD', '<p><strong style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">Acadia Pharmaceuticals (</strong><a href="https://seekingalpha.com/symbol/ACAD" target="_blank" style="background-color: rgb(255, 255, 255); color: rgb(2, 73, 153);"><strong>ACAD</strong></a><strong style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">)</strong><span style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">&nbsp;got several positive mentions after earnings results last week. JP Morgan ($50 price target) and H.C. Wainwright ($60 price target) reiterated their Buy ratings last Wednesday. Friday, Cowen &amp; Co. ($50 price target). I have to agree with these analyst firms. The stock''s over 10% pullback last week seem more than overdone given the company easily&nbsp;</span><a href="https://seekingalpha.com/news/3309283-acadia-pharma-beats-0_09-beats-revenue" target="_blank" style="background-color: rgb(255, 255, 255); color: rgb(2, 73, 153);">beat</a><span style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">&nbsp;top and bottom line expectations.</span></p><p><br></p><p><span class="ql-cursor">﻿</span>https://seekingalpha.com/article/4124394-biotech-forum-daily-digest-behind-omeros-blowout-results?app=1&amp;uprof=45&amp;isDirectRoadblock=true</p>', 0, 0, 0, 0, 0, null, 52.00, 47.00, 61.00, '2017-11-27 11:22:18', 22, null, 3, '2017-11-27 11:22:18', '2017-11-27 11:22:18');
INSERT INTO stocktracker.stock_analyst_consensus (uuid, customer_id, ticker_symbol, comments, analyst_strong_buy_count, analyst_buy_count, analyst_hold_count, analyst_under_perform_count, analyst_sell_count, analyst_sentiment_date, avg_analyst_price_target, low_analyst_price_target, high_analyst_price_target, analyst_price_date, notes_source_id, stock_price_when_created, version, create_date, update_date) VALUES (14, 1, 'TGTX', '<p>TGTX............H.C. Wainwright analyst Edward White assigned a Buy rating to TG Therapeutics (NASDAQ: TGTX) today and set a price target of $33. The company’s shares opened today at $7.70.</p><p><br></p><p>White said:</p><p><br></p><p>“TG Announces New Phase 2 Trial in Follicular Lymphoma for Umbralisib New trial in FL. TG Therapeutics announced this morning that it, along with SWOG, the global cancer clinical trials group funded by the National Cancer Institute, has initiated a three arm Phase 2 trial evaluating the combination of umbralisib (TGR-1202), TG’s oral PI3K delta inhibitor, plus obinutuzumab (Gazyva), compared to the combination of obinutuzumab plus lenalidomide, and obinituzumab plus CHOP, in patients with early relapsing or refractory Grade I, II, or IIIa follicular lymphoma (FL). The study, which will be run independently by SWOG, expects to enroll 50 patients per arm. The study is now open at over 100 sites in the US. The goal of the study is to assess CR following six cycles of treatment. Secondary endpoints include ORR, DOR and PFS. Safety will also be evaluated.”</p>', 5, 0, 0, 0, 0, '2017-12-01 08:00:29', 24.88, 21.50, 33.00, '2017-12-01 08:00:29', 21, null, 2, '2017-12-01 08:00:29', '2017-12-01 08:00:29');
